import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Utensils, IceCream } from 'lucide-react'; 
import amburguesa from '../Imagenes/amburguesa.jpg';
import cachapa from '../Imagenes/cachapa.jpg';
import arepaconquesoamarillo from '../Imagenes/arepa con queso amarillo.png';
import arepaconquesodemano from '../Imagenes/arepa.jpg';

const menuItems = [
  {
    id: 1,
    name: 'Amburguesa',
    description: 'La clásica arepa rellena de pollo desmechado con aguacate y mayonesa.',
    price: '8.50',
    image: amburguesa,
    category: 'salado'
  },
  {
    id: 2,
    name: 'Cachapa con Queso de Mano',
    description: 'Tierna tortilla de maíz dulce con abundante queso de mano derretido.',
    price: '9.00',
    image: cachapa,
    category: 'salado'
  },
  {
    id: 3,
    name: 'Arepa con queso amarillo',
    description: 'Carne premium, queso cheddar, bacon, cebolla caramelizada y nuestra salsa especial.',
    price: '12.00',
    image: arepaconquesoamarillo,
    category: 'salado'
  },
  {
    id: 4,
    name: 'Arepa con queso de mano',
    description: 'Refrescante helado cremoso con el toque ácido y dulce de la maracuyá.',
    price: '5.50',
    image: arepaconquesodemano,
    category: 'salado'
  },
  {
    id: 5,
    name: 'Arepa Pelúa',
    description: 'Arepa rellena de carne mechada y queso amarillo rallado.',
    price: '8.00',
    image: arepaconquesodemano,
    category: 'salado'
  },
  {
    id: 6,
    name: 'Cachapa con Pernil',
    description: 'Cachapa con jugoso pernil de cerdo asado y queso de mano.',
    price: '10.50',
    image: cachapa,
    category: 'salado'
  },
  {
    id: 7,
    name: 'Helado de Chocolate y Brownie',
    description: 'Cremoso helado de chocolate con trozos de brownie casero.',
    price: '6.00',
    image: 'https://images.unsplash.com/photo-1563805042-7684c019e1f6?q=80&w=1974&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
    category: 'dulce'
  },
  {
    id: 8,
    name: 'Helado de Vainilla con Caramelo',
    description: 'Clásico helado de vainilla con un remolino de salsa de caramelo.',
    price: '5.00',
    image: 'https://images.unsplash.com/photo-1570197784060-d3271122265f?q=80&w=1974&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
    category: 'dulce'
  }
];

const MenuSection = () => {
  const [filter, setFilter] = useState('all'); // 'all', 'dulce', 'salado'

  const filteredItems = menuItems.filter(item => {
    if (filter === 'all') return true;
    return item.category === filter;
  });

  const categoryButtons = [
    { name: 'Todo', value: 'all', icon: null },
    { name: 'Salado', value: 'salado', icon: Utensils },
    { name: 'Dulce', value: 'dulce', icon: IceCream }
  ];

  return (
    <section id="menu" className="py-20 bg-gradient-to-br from-amber-50 to-orange-100 overflow-hidden">
      <div className="container mx-auto px-6 max-w-6xl">
        <motion.h2 
          className="text-6xl font-extrabold text-center text-amber-700 mb-16 tracking-tight leading-tight"
          initial={{ opacity: 0, y: -50 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.5 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
        >
          Explora Nuestro <span className="bg-clip-text text-transparent bg-gradient-to-r from-amber-600 to-orange-500">Menú Exquisito</span>
        </motion.h2>

        <motion.div 
          className="flex justify-center mb-20"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.5 }}
          transition={{ delay: 0.3, duration: 0.7, ease: "easeOut" }}
        >
          <div className="bg-white p-3 rounded-full shadow-2xl flex space-x-4 border border-amber-200">
            {categoryButtons.map((button) => (
              <motion.button
                key={button.value}
                onClick={() => setFilter(button.value)}
                className={`px-8 py-4 rounded-full text-xl font-semibold flex items-center gap-3 transition-all duration-300 transform ${
                  filter === button.value
                    ? 'bg-gradient-to-r from-amber-500 to-orange-500 text-white shadow-lg scale-105'
                    : 'bg-gray-100 text-gray-700 hover:bg-amber-100 hover:text-amber-700'
                }`}
                whileHover={{ scale: 1.08, boxShadow: "0 10px 20px rgba(251, 191, 36, 0.3)" }}
                whileTap={{ scale: 0.95 }}
              >
                {button.icon && <button.icon className="w-6 h-6" />}
                {button.name}
              </motion.button>
            ))}
          </div>
        </motion.div>

        <motion.div layout className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-12">
          <AnimatePresence mode="wait">
            {filteredItems.map((item, index) => (
              <motion.div
                key={item.id}
                layout
                initial={{ opacity: 0, y: 50, scale: 0.9 }}
                animate={{ opacity: 1, y: 0, scale: 1 }}
                exit={{ opacity: 0, y: -50, scale: 0.9 }}
                transition={{ duration: 0.5, delay: index * 0.08, ease: "easeOut" }}
                className="bg-white rounded-3xl shadow-2xl overflow-hidden transform hover:scale-105 transition-all duration-300 cursor-pointer border-4 border-transparent hover:border-amber-400 group"
              >
                <div className="relative h-64 overflow-hidden">
                  <img 
                    src={item.image} 
                    alt={item.name} 
                    className="w-full h-full object-cover object-center transform group-hover:scale-115 transition-transform duration-700 ease-in-out"
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-black/70 to-transparent"></div>
                  <motion.span 
                    className="absolute bottom-6 left-6 bg-amber-500 text-white text-3xl font-bold px-5 py-2 rounded-full shadow-xl"
                    initial={{ opacity: 0, x: -20 }}
                    animate={{ opacity: 1, x: 0 }}
                    transition={{ delay: 0.2, duration: 0.4 }}
                  >
                    ${item.price}
                  </motion.span>
                </div>
                <div className="p-8">
                  <h3 className="text-4xl font-bold text-gray-900 mb-3 leading-tight">{item.name}</h3>
                  <p className="text-gray-600 text-lg leading-relaxed">{item.description}</p>
                </div>
              </motion.div>
            ))}
          </AnimatePresence>
        </motion.div>
      </div>
    </section>
  );
};

export default MenuSection;
